import React from "react";

export default function AddField() {
    return (
      <div>
      <button> Bio </button>;
      <button> Education </button>;
      <button> Work History </button>;
      <button> Project </button>;
      <button> Skills </button>;
      <button> Technologies </button>;
     </div>
    );
};
